import React, {useState} from "react";
import { Col } from "antd";
import {
   WrapperHeader,
   LogoText,
   NavbarWrapper,
   NavItem,
   SubnavItem,
   Dropdown,
   Subnav,
} from "./style";

const HeaderComponent = () => {
   const [currentPage, setCurrentPage] = useState('Home');
   const handleClick = (page) => {
      setCurrentPage = page
   }
return (
   <div>
      <WrapperHeader>
         <Col span={4}>
            <img src="" alt="" />
            <LogoText>Yen Scented Candle</LogoText>
         </Col>
         <Col span={14}>
            <NavbarWrapper>
            <NavItem>Home</NavItem>
            <Dropdown>
               <NavItem>Shop</NavItem>
               <Subnav className="subnav">
                  <SubnavItem>Collection 1</SubnavItem>
                  <SubnavItem>Collection 2</SubnavItem>
                  <SubnavItem>Collection 3</SubnavItem>
               </Subnav>
            </Dropdown>
            <NavItem>Blog</NavItem>
            <NavItem>About Us</NavItem>
            <NavItem>Account</NavItem>
            </NavbarWrapper>
         </Col>
         <Col span={2}>col-8</Col>
      </WrapperHeader>
   </div>
);
};

export default HeaderComponent;
